div.script:

//
function _showQuickSearchOptions() {
	$('quicksearch-select').addClassName('fakedd-open');
    $('quicksearch-select').removeClassName('fakedd-close');
	$('quicksearch-select-options').show();
}

function _hideQuickSearchOptions() {
	$('quicksearch-select').addClassName('fakedd-close');
    $('quicksearch-select').removeClassName('fakedd-open');
    $('quicksearch-select-options').hide();
}

function _setSelected(element_id) {
	$('quicksearch-select').update($(element_id).innerHTML);
	$('search-type').value = element_id;
    if(element_id == "qs_type_site" || element_id == "qs_type_site_alle") {$('quicksearch').addClassName("googlePowered");}
    else {if($('quicksearch').hasClassName('googlePowered')) $('quicksearch').removeClassName("googlePowered");}
	$$('#quicksearch-select-options ul li a.selected').each(function(s) {s.removeClassName('selected')});
	$(element_id).addClassName('selected');
}

function setSelected(element_id) {
	_hideQuickSearchOptions();
	_setSelected(element_id);
}

function parseUri (str) {
	var	o   = parseUri.options,
		m   = o.parser[o.strictMode ? "strict" : "loose"].exec(str),
		uri = {},
		i   = 14;

	while (i--) uri[o.key[i]] = m[i] || "";

	uri[o.q.name] = {};
	uri[o.key[12]].replace(o.q.parser, function ($0, $1, $2) {
		if ($1) uri[o.q.name][$1] = $2;
	});

	return uri;
};

Event.observe('quicksearch-select', 'click', function(event) {
	if($('quicksearch-select').hasClassName('fakedd-close')) {
	    _showQuickSearchOptions();
	} else {
	    _hideQuickSearchOptions();
	}
	Event.stop(event);
});

Event.observe('quicksearch-form', 'submit', function(event) {
    var query = escape($F('search').strip().replace(/\+/g,"$"));
	var queryEncoded = encodeURIComponent($F('search').strip());
    var type = $F('search-type').strip();
	if(type == "qs_type_news" || type == "gs_type_news_online-news") {
		parent.location.href = '/news/suche/' + query;
	} else if(type == "gs_type_news_online-news-filtered") {
		parent.location.href = '/news/suche/ohne-berichte/' + query;
	} else if(type == "qs_type_site" || type == "qs_type_site_alle") {
        $('quicksearch-form').action = "/";
        $('quicksearch').submit();
	} else if(type == "qs_type_kurse_alle" || type == "qs_type_kurse") {
		parent.location.href = '/boerse/suche/kurse/alle/' + queryEncoded;
	} else if(type == "qs_type_kurse_aktien") {
		parent.location.href = '/boerse/suche/kurse/aktien/' + queryEncoded;
	} else if(type == "qs_type_kurse_derivate") {
		parent.location.href = '/boerse/suche/kurse/derivative/' + queryEncoded;
	} else if(type == "qs_type_kurse_fonds") {
		parent.location.href = '/boerse/fonds/fondsguide/liste/suche/' + query;
	} else if(type == "qs_type_moneyhouse" || type == "qs_type_moneyhouse_firmen") {
		window.open('http://www.moneyhouse.ch/firmensuche.htm?ge=true&fr=true&f='+queryEncoded, "_blank");
	} else if(type == "qs_type_moneyhouse_personen") {
		window.open('http://www.moneyhouse.ch/personensuche.htm?ge=true&fr=true&short='+queryEncoded, "_blank");
	} else if(type == "qs_type_moneyhouse_stichwort") {
		window.open('http://www.moneyhouse.ch/stichwortsuche.htm?ge=true&fr=true&s='+queryEncoded, "_blank");
	} else {
		alert('Suche ' +type+ ' noch nicht definiert');
	}
	Event.stop(event);
});

parseUri.options = {
	strictMode: false,
	key: ["source","protocol","authority","userInfo","user","password","host","port","relative","path","directory","file","query","anchor"],
	q:   {
		name:   "queryKey",
		parser: /(?:^|&)([^&=]*)=?([^&]*)/g
	},
	parser: {
		strict: /^(?:([^:\/?#]+):)?(?:\/\/((?:(([^:@]*):?([^:@]*))?@)?([^:\/?#]*)(?::(\d*))?))?((((?:[^?#\/]*\/)*)([^?#]*))(?:\?([^#]*))?(?:#(.*))?)/,
		loose:  /^(?:(?![^:@]+:[^:@\/]*@)([^:\/?#.]+):)?(?:\/\/)?((?:(([^:@]*):?([^:@]*))?@)?([^:\/?#]*)(?::(\d*))?)(((\/(?:[^?#](?![^?#\/]*\.[^?#\/.]+(?:[?#]|$)))*\/?)?([^?#\/]*))(?:\?([^#]*))?(?:#(.*))?)/
	}
};

uri = parseUri(location.href);

if(uri.path.startsWith('/boerse/fonds/') || uri.query == "id=1161") {
	_setSelected('qs_type_kurse_fonds');
} else if(uri.path.startsWith('/boerse/derivate/')) {
	_setSelected('qs_type_kurse_derivate');
} else if(uri.path.startsWith('/boerse/')) {
	$('extended-quicksearch').update("<a title='Erweiterte Suche' href='/boerse/suche/erweitert'>erweitert &raquo;</a>");
	_setSelected('qs_type_kurse');
} else if(uri.path.startsWith('/news/suche/ohne-berichte/')) {
	_setSelected('gs_type_news_online-news-filtered');
} else if(uri.path.startsWith('/news/suche/')) {
	_setSelected('gs_type_news_online-news');
} else {
	_setSelected('qs_type_news');
}
