$j('.c2pLoginButton, .c2pLostPwdButton').live('click', function(e) {
    e.preventDefault();
    var clickedTarget = $j(this);
    var container = clickedTarget.parent().next();
    if(container.is(':visible')) {
        container.slideUp('slow');
    } else {
        container.slideDown('slow', function() {
            container.find('input:text').focus();
        });
    }
});
$j('.c2pLogoffButton').live('click', function(e) {
    e.preventDefault();
    $j('#c2pLogoff').submit();
});
$j('#c2pLostPwd').live('submit', function(e) {
    e.preventDefault();
    $j.post('/services/user/lost_password.php', {lostPasswordUsername: $j("#lostPasswordUsername").val()}, function() {
        $j('#c2pLostPwd').parent().slideUp('slow');
    });
});
$j('#txtLoginAutologin').live('click', function(e) {
  if($j('#txtLoginAutologin').is(':checked'))
    if (!confirm("Achtung: Eingeloggt bleiben ist ein Sicherheitsrisiko. Trotzdem auswählen?"))
      $j('#txtLoginAutologin').attr('checked', false);
});
